import "./nav.scss";
import { ReactComponent as Logo } from "../../assets/crown.svg";
import { Link, Outlet } from "react-router-dom";
import { Fragment } from "react";

import { useContext } from "react";
import { UserContext } from "../../contexts/user.context";

function Nav({ links }) {
	const { currenntUser } = useContext(UserContext);

	let userDisplayNameOrEmail = "";

	try {
		currenntUser.displayName
			? (userDisplayNameOrEmail = currenntUser.displayName)
			: (userDisplayNameOrEmail = currenntUser.email);
		console.log("Nav:", "userDisplayNameOrEmail:", userDisplayNameOrEmail);
	} catch (error) {
		console.log("Nav:", "No user logged in at the moment.");
	}

	const handleSignOutClick = (e) => {};

	return (
		<Fragment>
			<div className="navigation">
				<Link className="logo-container" to="/">
					<Logo className="logo" />
				</Link>
				<div className="nav-links-container">
					{links.map(({ text, to }) => {
						if (!currenntUser && to !== "/sign-out") {
							return (
								<Link key={to} className="nav-link" to={to}>
									{text}
								</Link>
							);
						} else if (currenntUser && to !== "/sign-in-up") {
							if (to === "/sign-out") {
								return (
									<Link key={to} className="nav-link" to={to} onClick={handleSignOutClick}>
										{text}
									</Link>
								);
							}
						} else return null;
					})}
					<Link key="userDisplayNameOrEmail" className="nav-link" to="#">
						{userDisplayNameOrEmail}
					</Link>
				</div>
			</div>
			<Outlet />
		</Fragment>
	);
}

export default Nav;
